import React from 'react';
import './App.css';
import Login from './components/Login/Login';
import Navbar from './components/Navbar/Navbar';
import { BrowserRouter, Route } from 'react-router-dom';

function App() {
  return (
    <div className="App">
      <BrowerRouter>
        <Route path="/login" component={Login} />
      </BrowerRouter>
    </div>
  );
}

export default App;
